function parseXEC(i){let a=false;i.split(".").length===1?a=true:i.split(".").slice(1).forEach((x)=>{if(isNaN(parseInt(x))){a=true}});return a?encodeXEC(i):decodeXEC(i)}
function encodeXEC(i){i=i;return "Coming Soon.."}
function decodeXEC(i){let a=i.split(".").slice(1).map((x)=>{return parseInt(x)}),b=[],c=0,d={},e=0;if(a.length%3!==0){return}for(let i=0;i<a.length;i+=3){b.push(a[i]+a[i+1]+a[i+2])}b.forEach((x)=>{d[x]=(d[x]||0)+1;if(d[x]>e){e=d[x];c=x}});return String.fromCharCode(...b.map((x)=>{return x-c+32}))}